public static boolean supports(CryptoProtocolVersion version) {
  if (version.getVersion() == UNKNOWN.getVersion()) {
    return false;
  }
  for (CryptoProtocolVersion v : CryptoProtocolVersion.values()) {
    if (v.getVersion() == version.getVersion()) {
      return true;
    }
  }
  return false;
}
